const celestiump2p = {
  RTCPeerConnection: null,
  RTCSessionDescription: null,
  RTCIceCandidate: null,
  testShit(x) {
    const io = require("socket.io")({
      serveClient: false,
    });

    return new celestiump2p.RTCPeerConnection(x);
  },
};

module.exports = celestiump2p;
